  list,
  onSelectArtist,
  onDeleteArtist,
  onUpdateArtist,
  selectedArtist,
}) {
  return list.length === 0 ? (
    <div className={"details"}>
      <p className={"box-text-no-data"}>
        No artists available. <br></br>
